const dateString = $input.item.json["Date sent"];
const [datePart, timePart] = dateString.split(', ');
const [month, day, year] = datePart.split('/');
const dateSent = new Date(year, month - 1, day);
const currentDate = new Date();
const today = new Date(currentDate.getFullYear(), currentDate.getMonth(), currentDate.getDate());
const timeDifference = today.getTime() - dateSent.getTime();
const daysDifference = timeDifference / (1000 * 60 * 60 * 24);

return {
  ...$input.item.json,  // Keep all original data
  canSendFollowUp: daysDifference >= 2,
  daysPassed: daysDifference
};

